CREATE PROCEDURE [dbo].[pSetup$SF#ApplicationReport]
	@SetupUser nvarchar(75) -- user assigned to audit columns
 ,@Language	 char(2)			-- language to install for
 ,@Region		 varchar(10)	-- designator for locale to generate data for
as
/*********************************************************************************************************************************
Sproc    : Setup sf.ApplicationReport data
Notice   : Copyright Â© 2012 Softworks Group Inc.
Summary  : Updates sf.ApplicationReport master table with values for built-in system reports
----------------------------------------------------------------------------------------------------------------------------------
History  : Author(s)    | Month Year    | Change Summary
				 : ------------ | ------------- |-----------------------------------------------------------------------------------------
				 : Tim Edlund		| Oct	2013			| Initial Version
				 : Christian T	| April 2014		| Added test harness
				 : Russ Poirier | Feb 2017      | Added three new reports: Application User Roles, Assigned User Licenses, and Security
																					Role Membership
				 : Robin Payne	| Sep 2017			| Added Renewal Status Summary Report
				 : Robin Payne	| Oct 2017			| Revenue Summary Report
				 : Gunjan P     | Jan 2018      | Added GLAccount dropdown list for Journal Entry Detail Report
				 : Taylor N			| Jan 2018			| Added paging to the Deposit Details and Journal Entry Details reports
				 : Gunjan P     | Feb 2018      | Added Audit status summary, Completed by Week , Form Completion Time and Outstanding Invoices
				 : Karun K			| Aug 2018			| Added group summary, group members, updated format of date from yyyy-MMM-dd to dd-MMM-yyyy
				 : Karun K			| Oct 2018			| Sorting on all registration year parameters
				 : Russ Poirier	| Mar 2019			| Added Registration Changes report
----------------------------------------------------------------------------------------------------------------------------------
Comments
--------

This procedure inserts built-in application reports to the sf.ApplicationReport table.  This table is also used to store custom
report definitions, however, custom reports are not addressed by setup. Custom reports must be inserted by the configurator
working on the deployment either manually, or through scripts.  Any custom reports that exist in the table at the time this
procedure is run are left unchanged.

Note that this procedure begins by automatically deleting the existing set of built-in reports.  To do this the procedure first
deletes sf.ApplicationPageReport records which show which pages the report has been assigned to, and then deletes the report
records.  Custom reports are ignored (they have the IsCustom bit set to 1).

The report definition XML and parameter XML is included in the sourtagce code directly.  It is not inserted from the file system
in order to simplify new installations.


<TestHarness>
	<Test Name="Basic" IsDefault="true" Description="Ensures sproc executes successfully. If no child records exist, previous set up data is deleted prior to test.">
		<SQLScript>
		<![CDATA[

			if	not exists (select 1 from sf.ApplicationPageReport where ApplicationReportSID is not null)
			begin
				delete from sf.ApplicationReport
				dbcc checkident( 'sf.ApplicationReport', reseed, 1000000) with NO_INFOMSGS
			end
			
			exec dbo.pSetup$SF#ApplicationReport
				 @SetupUser = 'system@alinityapp.com'
				,@Language = 'EN'
				,@Region = 'CA'

			select * from sf.ApplicationReport

		]]>
		</SQLScript>
		<Assertions>
			<Assertion Type="NotEmptyResultSet" ResultSet="1"/>
			<Assertion Type="ExecutionTime" Value="00:00:05" />
		</Assertions>
	</Test>
</TestHarness>

exec sf.pUnitTest#Execute
	 @ObjectName = 'dbo.pSetup$SF#ApplicationReport'
	,@DefaultTestOnly = 1
------------------------------------------------------------------------------------------------------------------------------- */

