s"><Query><DataSourceName>DataSource1</DataSourceName><QueryParameters><QueryParameter Name="@cutOffDate"><Value>=Parameters!cutOffDate.Value</Value></QueryParameter></QueryParameters><CommandText>select   z.RegistrantLabel  , z.InvoiceDate  , z.InvoiceSID  , z.InvoiceType  , z.TotalAfterTax  , z.TotalPaid  , case  when datediff(day, z.InvoiceDate, sf.fToday()) &lt; 30 then TotalDue   end as ''&lt;30days'' 	 , case   when datediff(day, z.InvoiceDate, sf.fToday()) between 30 and 60 then TotalDue    end as ''30-60 days''  , case  when datediff(day, z.InvoiceDate, sf.fToday()) &gt; 60 then TotalDue   end as ''61 + days''  , count(1) FormCount  from  ( select    dbo.fRegistrant#Label(i.LastName, i.FirstName, i.MiddleNames, r.RegistrantNo, null) RegistrantLabel  ,i.InvoiceDate   ,i.InvoiceSID  ,coalesce(ltrim(rr.RegistrationYear)+'' Renewal'',ltrim(ra.RegistrationYear)+'' Application'', ltrim(ri.RegistrationYear)+'' Reinstatement'', ''Other'')  InvoiceType  ,i.TotalAfterTax  ,i.TotalPaid  , i.TotalDue   from dbo.vInvoice i   join  dbo.Registrant  r         on i.PersonSID = r.PersonSID  left outer join  dbo.RegistrantApp   ra     on i.InvoiceSID = ra.InvoiceSID  left outer join  dbo.RegistrantRenewal   rr on i.InvoiceSID = rr.InvoiceSID  left outer join  dbo.Reinstatement     ri    on i.InvoiceSID  = ri.InvoiceSID  where  IsUnpaid = 1  and  i.InvoiceDate &lt;= @cutOffDate  ) z  group by  z.RegistrantLabel  , z.InvoiceDate  , z.InvoiceSID  , z.InvoiceType  , z.TotalAfterTax  , z.TotalPaid  , TotalDue   order by InvoiceDate desc</CommandText><rd:UseGenericDesigner>true</rd:UseGenericDesigner></Query><Fields><Field Name="InvoiceDate"><DataField>InvoiceDate</DataField><rd:TypeName>System.DateTime</rd:TypeName></Field><Field Name="InvoiceSID"><DataField>InvoiceSID</DataField><rd:TypeName>System.Int32</rd:TypeName></Field><Field Name="TotalAfterTax"><DataField>TotalAfterTax</DataField><rd:TypeName>System.Decimal</rd:TypeName></Field><Field Name="TotalPaid"><DataField>TotalPaid<