		insert
			sf.ApplicationReport
		(
			ApplicationReportName
		 ,IconPathData
		 ,IconFillColor
		 ,DisplayRank
		 ,ReportDefinition
		 ,ReportParameters
		 ,IsCustom
		 ,CreateUser
		 ,UpdateUser
		)
		select
			s.ApplicationReportName
		 ,s.IconPathData
		 ,s.IconFillColor
		 ,s.DisplayRank
		 ,s.ReportDefinition
		 ,s.ReportParameters
		 ,@OFF
		 ,@SetupUser
		 ,@SetupUser
		from
			@setup s
		order by
			s.ID;

		-- check count of @setup table and the target table
		-- target should have at least as many rows as @setup

		select @sourceCount	 = count(1) from @setup ;
		select @targetCount	 = count(1) from sf .ApplicationReport;

		if isnull(@targetCount, 0) < @sourceCount
		begin

			exec sf.pMessage#Get
				@MessageSCD = 'SetupCountTooLow'
			 ,@MessageText = @errorText output
			 ,@DefaultText = N'Insert of some setup records failed. Source table count is %1 but target table (%2) count is only %3. Check "JOIN" conditions.'
			 ,@Arg1 = @sourceCount
			 ,@Arg2 = 'sf.ApplicationReport'
			 ,@Arg3 = @targetCount;

			raiserror(@errorText, 18, 1);
		end;

	end try
	begin catch
		exec @errorNo = sf.pErrorRethrow;
	end catch;

	return (@errorNo);

end;
GO
